content.css:
.IHRoot {
  padding-left: 0px;
}
.Header {
  padding-left: 20px;
}
.IHPRoot {
  display: flex;
  flex-direction: column;
}
.expandMoreIcon {
  color: aliceblue;
}
.desc2 {
  font-size: 5px;
}
.timestamp {
  display: left;
}
.desc {
  padding: 10px;
}
.IHTitle {
  background-color: #0d1130;
  display: flex;
  color: aliceblue;
  align-items: center;
  width: 100%;
  height: 15%;
}
.IHTitle img {
  padding-left: 5px;
}
.IHTitle span {
  padding-left: 20px;
}
.upRightFromSquare {
  position: relative;
  padding-left: 125px;
}
.upRightFromSquare2 {
  position: relative;
  padding-left: 150px;
}
.subText {
  padding: 15px;
  font-size: small;
  color: #6271a4;
}
.myimg img {
  border-radius: 20px;
}
.myDiv {
  width: 35px;
  height: 5px;
  background-color: black;
  margin: 6px 0;
}
.IHP {
  background-color: "aliceblue";
}
.IHP span {
  padding-left: 20px;
  position: relative;
  top: 0px;
  font-size: small;
  font-weight: bold;
  text-align: right;
  justify-content: right;
}
.IHP h5 {
  padding-left: 5px;
  position: relative;
  top: 0px;
}
.desc2 {
  font-size: small;
  font-family: sans-serif;
}
.arrowTrendUp {
  background-color: #cee1f1;
  border-radius: 20px;
  font-size: large;
  color: #104778;
}
.MuiAccordionDetails-root {
  margin: 0px;
}
.file {
  font-size: medium;
  height: 16px;
  font-size: small;
  color: aliceblue;
  padding-top: 2px;
}
.bIcon {
  color: aliceblue;
  padding: 5px;
  margin-top: 5px;
  height: 20px;
  font-size: small;
}
.desc3 {
  font-size: small;
  padding-left: 5px;
}
button {
  display: none;
}
.MuiIconButton-root {
  display: none !important;
  color: aliceblue;
}
.desc {
  font-size: 15px;
  color: #6271a4;
}
.icon {
  padding: 5px;
  margin-top: 5px;
  height: 20px;
}
